window.bookSummaryJSON = "\"A totally gripping tale.\" - Goodreads reviewer<br>In this thrilling page-turner, Ellie, a resourceful and determined young woman, finds herself locked in a cellar with no way out. With time ticking by, and danger looming, Ellie must use her wits to outsmart her captor. Meanwhile, DCI Alice Candy works to unravel the mystery of Ellie's abduction and locate her before it's too late. As Ellie fights to survive and take control of her own destiny, she must master her fears and harness the strength to break free from her captor's grasp. Full of suspense and unexpected twists, this gripping novel will keep you on the edge of your seat until the very end."; 
